The patch is to:
1. For default case, allow threads to be created evenly among processor groups with affinity set properly;
2. For customized affinity, allow ort user to attach threads to the desired set of processors and groups;

Two configuration entries opened:
1. c API for setting affinity for threads in global thread pool;
2. customization also available via session option for session-level thread pools;

Note the fix works exclusively for windows, more general fixes will be available soon in new releases.
In addition to code changes, a handful of YML files also get updated since the docker images running them are no longer fitful for running 1.7 branches, specifically, we have the following kinds of build errors:

1. Docker image not found;
2. Pybind and std header confliction;
3. Model failed to be loaded upon testing;
4. WinML library version mismatch.

1. Rename the partitioner;
2. Letting ::partition function return a status;
3. A few other minor fixes.
